import React from "react";
import ReactDom from 'react-dom';
import Joke from "./Jokes.js";

const myarray = Joke.map(function(x)
{
  return <h1>{x}</h1>
})

const Jokes = () => 
{

  return (
    <>
      {myarray}

    </>
  )
}






const Element = <>
  <Jokes/>

</>

const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element)
